import { Container, Col, Row } from "react-bootstrap";
import loader from "./assets/loader.svg";
import loadertext from "./assets/loadertext.svg";

export const PopularLoading = () => {
	return (
		<div>
			<Col xs={12} md={6} lg={3} className="mb-3">
				<Container>
					<Row
						className="bg-white py-3 "
						style={{ borderRadius: 5, cursor: "pointer", minHeight: "110px" }}
					>
						<Col xs={3} className="text-center">
							<img
								src={loader}
								style={{ width: "65px", height: "65px", objectFit: "cover" }}
							/>
						</Col>
						<Col xs={9} className="my-auto text-center">
							<img
								src={loadertext}
								style={{ width: "70px", height: "50px", objectFit: "cover" }}
							/>
						</Col>
					</Row>
				</Container>
			</Col>
		</div>
	);
};

const CardPopular = (props) => {
	const { name, image, id } = props.data;

	return (
		<>
			<Col xs={12} md={6} lg={3} className="mb-3">
				<Container>
					<Row
						className="bg-white py-3 "
						style={{ borderRadius: 5, cursor: "pointer", minHeight: "110px" }}
					>
						<Col xs={3} className="text-center">
							<img
								src={loader}
								style={{ width: "65px", height: "65px", objectFit: "cover" }}
								alt={name}
							/>
						</Col>
						<Col xs={9} className="my-auto text-center">
							<h5 className=" my-0 font-weight-bold ">{name}</h5>
						</Col>
					</Row>
				</Container>
			</Col>
		</>
	);
};

export default CardPopular;
